import{_ as t,a,J as o,o as r}from"./chunks/framework.BWf-PbcG.js";const n="/images/build/zdaniya-02.png",O=JSON.parse('{"title":"OOLEY42","description":"Передвижная открытая мастерская","frontmatter":{"title":"OOLEY42","description":"Передвижная открытая мастерская","date":"2014-10-22","icon":"logo.png","cover":"cover.jpg","vk":"ooley42","instagram":"ooley42","url":"https://ooley.ru","tel":"+7 (963) 979-02-04"},"headers":[],"relativePath":"practice/ooley42/index.md","filePath":"practice/ooley42/index.md"}'),l={name:"practice/ooley42/index.md"};function s(i,e,p,c,d,g){return r(),a("div",null,e[0]||(e[0]=[o('<h3 id="передвижная-мастерская-ooley42" tabindex="-1">Передвижная мастерская OOLEY42 <a class="header-anchor" href="#передвижная-мастерская-ooley42" aria-label="Permalink to &quot;Передвижная мастерская OOLEY42&quot;">​</a></h3><p><img src="'+n+'" alt=""></p><p><a href="/practice/ooley42/"><strong>OOLEY42</strong></a> – это компактная передвижная универсальная мастерская, помещающаяся в прицеп-автодом и разворачивающаяся в любом подходящем пространстве. Это наша экспериментальная площадка, позволяющая на практике изучать основы творчества и обнаруживать действенные подходы к продуктивному сотрудничеству. Мы открыты к предложениям проведения лекций, выездных мастер-классов и воркшопов, создания всевозможных арт-объектов и совместных архитектурных и дизайн-проектов.</p><p>Передвижная мастерская с прицепом OOLEY42 – это экспериментальная площадка для проведения полевых испытаний теории устойчивых открытых мастерских. Мы проектируем и практикуем устройство самых разных временных и постоянных мастерских в самых разнообразных условиях.</p><p>Оборудованный для работы с ручным и электрическим инструментом, наполненный различными инструментами и материалами, прицеп OOLEY42 позволяет проводить различные мероприятия почти в любом месте. В хорошую погоду прицеп может обеспечить всем необходимым для проведения множества различных работ группами до 20—30 человек, а в дожди и холода 5—7 человек смогут найти укрытие под большим раздвижным тентом и внутри прицепа, предоствляющего возможность приготовить горячий чай, а также согреться у газового камина в холодное время года.</p><p><a href="/practice/ooley42/tools-list/">Актуальный список доступных для использования инструментов передвижной мастерской OOLEY42.</a></p><p>Вы можете подписаться на наш <strong><a href="http://instagram.com/ooley42" title="Instagram" class="external-link" target="_blank" rel="noreferrer">Instagram</a></strong> или следить за обновлениями в нашей <strong><a href="http://vk.com/ooley42" title="OOLEY42 VK" class="external-link" target="_blank" rel="noreferrer">группе VK</a>.</strong></p>',7)]))}const f=t(l,[["render",s]]);export{O as __pageData,f as default};
